function Signup(){
    const title = "hello"
    const desc1 = "students"
    const desc2 = "kese hai"
    return(
        <div>
            <Template title={title} desc1={desc1} desc2={desc2} formtype={formtype} image={image}/>
        </div>
    )
}
export default Signup;
